Lisenssin tunnistaja, ollen maailmanlaajuisesti uniikki tunniste lisenssille tai sopimukselle, jonka alaisuudessa kohteet tuotetaan, jätetään käsittelyyn ja/tai maksetaan, ja joka on rakennettu yhdistämällä:
 - ISO/IEC 15459 myöntämisviraston koodi;
 - lisenssi- tai sopimusnumero, joka vastaa kyseisen myöntämisviraston määrityksiä;
 ja joka:
 - koostuu vain isoista kirjaimista ja/tai numeromerkeistä;
 - on uniikki (eli eroaa kaikista muista ISO/IEC 15459:n mukaisista tunnisteista) myöntämisviraston alueella;
 - ei voida johtaa mistään muusta ISO/IEC 15459:n mukaisesta tunnisteesta, joka on myönnetty saman myöntämisviraston toimesta, yksinkertaisesti lisäämällä merkkejä sen päähän tai poistamalla niitä siitä.

