'26L' Sijaintikoodi, ollen koodi, joka tunnistaa sijainnin tai maantieteellisen alueen, tai niihin liittyvän ryhmän sijainteja tai alueita, jolla on merkitystä liittyvään transaktioon ja joka noudattaa alla määriteltyjä yhtä (a) kohti (f) rakenteita:
a) kaksi isoilla kirjaimilla kirjoitettua aakkosmerkkiä vastaten ISO 3166-1 kahden aakkoskoodin maakoodia maassa, jossa tai josta koostuen, sijainnit tai alueet sijaitsevat;
b) kolme isoilla kirjaimilla kirjoitettua aakkosmerkkiä vastaten IATA:n lentokentän tai kaupungin koodia, jossa, lähellä tai josta koostuen, sijainnit tai alueet sijaitsevat;
c) neljä tai useampia merkkejä, joista ensimmäiset kolme vastaavat ISO 3166-1 maakoodia, jonka jälkeen viiva (-), jäljellä olevan osan ollessa postinumero kyseisessä maassa;
d) neljä tai useampia merkkejä, joista ensimmäiset kolme vastaavat ISO 3166-1 maakoodia, jonka jälkeen piste (.), jäljellä olevan osan ollessa ISO 3166-2 maan alajaon koodi kyseisessä maassa;
e) viisi isoilla kirjaimilla kirjoitettua aakkosmerkkiä vastaten YK:n/LOCODEN aluekoodia alueella, jossa, lähellä tai josta koostuen, sijainnit tai alueet sijaitsevat;
f) yhdistelmä, joka on vähintään seitsemän tai enintään 35 merkkiä pitkä, koostuen:
- ISO/IEC 15459 myöntämisviraston koodista;
- sijaintikoodista, joka koostuu merkeistä {A-Z; 0-9} ja joka vastaa myöntämisviraston määrityksiä.

