Laitetunniste, joka on maailmanlaajuisesti uniikki tunniste laitteelle, laitteistolle tai tietokoneohjelman instanssille, jota käytetään tuotteiden tuotannossa, kuljetuksessa, käsittelyssä tai muussa käsittelyssä.

UPU Sijaintikoodi, joka on koodi, joka tunnistaa sijainnin tai maantieteellisen alueen, tai siihen liittyvän ryhmän tällaisia sijainteja tai alueita, joilla on merkitystä liittyvään transaktioon ja joka noudattaa yhtä alla olevista rakenteista a) - g):
a) kaksi isoa kirjainta vastaavat ISO 3166-1 kahden kirjaimen maakoodia maasta, jossa tai josta koostuu sijainti tai alueet;
b) kolme isoa kirjainta vastaavat IATA-koodia lentokentästä tai kaupungista, jossa, lähellä tai josta koostuu sijainti tai alueet;
c) neljä tai useampi merkki, joiden ensimmäiset kolme vastaavat ISO 3166-1 maakoodia, seurattuna viivalla (-), jäljellä oleva osa on postinumero kyseisessä maassa;
d) neljä tai useampi merkki, joiden ensimmäiset kolme vastaavat ISO 3166-1 maakoodia, seurattuna pisteellä (.), jäljellä oleva osa on ISO 3166-2 maan alajaon koodi kyseisessä maassa;
e) viisi isoa kirjainta vastaavat YK:n paikkakoodia alueesta, jossa, lähellä tai josta koostuu sijainti tai alueet;
f) kuusi isoa alfanumeerista merkkiä vastaavat UPU:n IMPC-koodia, joka on määritetty UPU-standardin S34 mukaisesti;
g) yhdistelmä, joka on vähintään seitsemän, mutta enintään 25 merkkiä pitkä, koostuen:
 - myöntäjäkoodista, joka on määritetty UPU-standardien S31 mukaisesti;
 - sijaintikoodista, joka koostuu joukosta {A-Z; 0-9} ja noudattaa myöntäjän eritelmiä.

Rekisterikilpi Palveludatan ja Sijaintikoodin kanssa on yhdistetty datarakenne, joka on yhteensopiva UPU-standardin S25 eritelmän kanssa, joka sisältää määrityksen:
 - ISO/IEC 15459:n mukainen esinetunniste;
 - data-identifioija 5U:n mukainen määritys palvelusta, joka on tarjottava esineelle;
 - data-identifioija 17U:n mukainen UPU sijaintikoodi tai data-identifioija 18U:n mukainen pätevä UPU sijaintikoodi.
 Huomautus - Lisätietoja varten, katso UPU-standardi S25. Ero yksinkertaisen UPU sijaintikoodin (DI 17U) ja pätevän UPU sijaintikoodin (DI 18U) välillä voidaan määrittää ensimmäisen merkin perusteella. Jos tämä on numeerinen, sovelletaan 18U; jos se on alfabeettinen, sovelletaan 17U.

