Päivämäärä, esitetty muokatussa UTC-yhteensopivassa muodossa:
yyyy[mm[dd[hh[mm[ss[fff]]]]]][poooo], missä hakasulkeet osoittavat valinnaisuutta ja yyyy on vuosi, mmdd kuukausi ja päivä, hhmmss kellonaika tunneissa, minuuteissa ja sekunneissa, fff sekuntien murto-osat ja poooo UTC:stä poikkeama tunteina ja minuutteina, poikkeama on positiivinen, jos p on piste (.), negatiivinen, jos P on miinusmerkki (-).
