- päivämäärästä, jonka muoto ja tulkinta noudattavat viraston määrityksiä kyseiselle päivämäärän määritelmälle.

Pakkausmateriaalin luokituksen*, koodin* ja painon ilmoitus tietylle pakkausmateriaalille, jota käytetään tietyssä pakkauksessa EU:n pakkaus- ja pakkausjätedirektiivin mukaisesti. (Materiaaliluokka ja -koodi määritelty liitteessä M).
12ECCMMMMMMNNNNNUU, missä: - '12E' (an3) on Tietotunniste;
 - 'CC' (n2) on Materiaaliluokka liitteen M mukaan;
 - 'MMMMMM' (an1...6) on Materiaalikoodi liitteen M mukaan;
 - 'NNNNN' (n5) Materiaalin paino, desimaalipiste mukaan lukien (esim., 12.12);
 - 'UU' (an2) on painon mittayksikkö (esim., KG, GR, LB tai OZ ANSI X12.3:n mukaan liitteessä D).

