Vastaanottajan Numero.
Yksilöllinen tunnistenumero voi olla IRS, EIN, SSN tai CBP:n määrittämä numero, kuten Turvallisuusilmoituksessa vaaditaan. Vain seuraavia muotoja tulee käyttää: IRS EIN: NN-NNNNNNN;
IRS EIN suffiksilla:
NN-NNNNNNNXX;
SSN: NNN-NN-NNNN;
CBP:n määrittämä nro: YYDDPP-NNNNN.
